description:
Фуговально-рейсмусовый станок FABTEC PT250 62694&nbsp;предназначен для строгания заготовок из дерева;

Столы (рейсмусовый и фуговальный) изготовлены из массивного износостойкого чугуна;

Строгальный вал имеет 2 ножа, которые вращаются со скоростью 9000 об/мин, что гарантирует высокое качество обработки;

Регулировка подачи стола позволяет выполнять точную обработку заготовок.
